import React, { useEffect, useState, Component } from "react";
import classes from "../styles/HeaderBurger.module.css";
import Footer from "../components/Footer";
import { useDispatch, useSelector } from "react-redux";
import Navigation from "../components/Navigation";
import logoWhite from "../img/logoW.png";
import IconBurger from "../img/x.png";

function Auto() {
  return (
    <div className={classes.Jewelry}>
      <div className={classes.wth} style={{ marginTop: "27px" }}>
        <Navigation
          icon={logoWhite}
          iconBurger={IconBurger}
          url={"/"}
        ></Navigation>
      </div>
      <p style={{ borderTop: "2px solid #fff", margin: "30px 162px" }}></p>
      <div className={classes.registForm}>
        <form className={classes.form} action="" method="post">
          <h1>РЕГИСТРАЦИЯ</h1>
          <input className={classes.input} type="text" placeholder="Ваше имя" />
          <input
            className={classes.input}
            type="email"
            placeholder="Ваш e-mail"
          />
          <input
            className={classes.input}
            type="tel"
            placeholder="Ваш телефон"
          />
          <input
            className={classes.input}
            type="password"
            placeholder="Пароль"
          />
          <input
            className={classes.input}
            type="password"
            placeholder="Пароль еще раз"
          />
          <button className={classes.btn} type="submit">
            Регистрация
          </button>
          <div style={{ float: "left" }}>
            Нет аккаунта? <div>Зарегиструруйся!</div>
          </div>
        </form>
      </div>
      <p style={{ borderTop: "2px solid #fff", margin: "30px 162px" }}></p>
      <Footer></Footer>
    </div>
  );
}

export default Auto;
